def fields(items, fieldX, fieldY):
	"""
	'price_by_meter', 'residents', 'occupied_private_housing', 'residents_per_household', 
	'delegacy', 'hospital', 'ubs', 'upa', 'school', 'market', 'shopping', 'university', 'bank']
	"""
	from scipy import linspace, polyval, polyfit, sqrt, stats, randn, mean
	from pylab import plot, title, show , legend, grid, xlabel, ylabel

	x = []
	y = []
	for i in items:
		x.append(i[fieldX])
		y.append(i[fieldY])

	a = min(x)
	b = max(x)
	# x=polyval([a,b],x)
	
	(ar,br)=polyfit(x,y,1)
	xr=polyval([ar,br],x)
	
	l = []
	for i in range(len(x)):
		l.append(x[i]/xr[i])

	#compute the mean square error
	err=sqrt(sum((xr-x)**2)/len(x))

	# print('Linear regression using polyfit')
	# print('parameters: a=%.6f b=%.6f \nregression: a=%.6f b=%.6f, ms error= %.6f' % (a,b,ar,br,err))

	title('Linear Regression Example')
	plot(x,y,'g.')
	plot(x,xr,'b.-')
	xlabel(fieldX)
	ylabel(fieldY)
	grid(True)
	legend(['original','regression'])
	show()
	return mean(l) 

